    return (
        <div className="tile is-ancestor">
            <div className="tile is-parent">
                <div className="tile is-child box">
                    <div className="columns">
                        <div className="column"></div>

                    </div>
                    <CardContent />
                </div>
            </div>
        </div>
    );
}

export default BodyNoLogin
